The '''Lunar Isle Mine''' (also called the '''Lunar Mine''') is located in the north-eastern part of [[Lunar Isle]]. It contains a [[Rune Essence (rock)|rune essence rock]] in the centre. It also contains the only known place to mine [[Lunar ore]], in addition to [[gem rock]]s just like in [[Shilo Village (location)|Shilo Village]]. [[Cyrisus]] can be found wounded in a nearby cave accessible through a crack, starting the [[Dream Mentor]] [[quest]].
{{Map|x=2142|y=3944|r=4|mtype=square|align=left|caption=The entrance to the mine.|width=250|height=250}}

==Rocks==
*In the centre is [[Rune Essence (rock)|rune essence]].
*To the west are six [[gold rock]]s, and stalagmites which can be mined for [[Lunar ore]].
*To the south are three [[silver rock]]s.
*To the south-east are three [[gem rock]]s.
*To the north-east is one gold, two silver and a gem rock.

